// StartYourJourney.js
import React from 'react';

const StartYourJourney = () => {
  const shapeStyle = {
    position: 'absolute', // Positioning the shape using absolute positioning
    left: '0',            // X position
    top: '0',             // Y position
    width: '100%',        // Full width of the ScrollingBox
    height: '100%',       // Full height of the ScrollingBox
    backgroundColor: '#FFFFFF', // Set to white
    borderRadius: '16px', // Corner radius
    opacity: 1,           // 100% opacity
    boxShadow: '4px 0px 4px rgba(0, 0, 0, 0.5), 0px 4px 4px rgba(0, 0, 0, 0.5)', // Drop shadow
    zIndex: 30            // Higher z-index to be on top
  };

  return (
    <div style={shapeStyle}>
      {/* Add your content here */}
      <h2 style={{ textAlign: 'center', padding: '20px' }}>Your Journey Content Here</h2>
      {/* Example placeholder content */}
      <p style={{ textAlign: 'center' }}>Some more content to fill the area...</p>
    </div>
  );
};

export default StartYourJourney;
